        </div>
        <div className="icons">
            <SearchIcon/>
        </div> */}

        <navbar className="nav"> 
            <div className="flex-nav">
                <img src={Logo} className="logo" alt=""/>
                <div className="nav-link">
                    <ul>
                        <li className="nav-item">
                            <FormControl c>
                                <InputLabel>
                            <Select  >
                                <MenuItem value={10}>Ten</MenuItem>
                                <MenuItem value={20}>Ten</MenuItem>
                                <MenuItem value={30}>Ten</MenuItem>
                                <MenuItem value={40}>Ten</MenuItem>
                            </Select>
                            </InputLabel>
                            </FormControl>
                        </li>
                        <li className="nav-item"><a href="#">EN</a></li>
                        <li className="nav-item"><a href="#">EN</a></li>
                        <li className="nav-item"><NavLink to="/contact"><Button variant="contained">Hello World</Button></NavLink></li>
                    </ul>
                </div>
            </div>
        </navbar>
        </>
    )

}
export default Navbar;
